$(document).ready(function(){$("#upload").click(function(){for(var r=$("#files").get(0),t=r.files,i=new FormData,n=0;n<t.length;n++)i.append(t[n].name,t[n]);$.ajax({type:"POST",url:"/home/UploadFilesAjax",contentType:!1,processData:!1,data:i,success:function(n){$(".messagebox").html(n)},error:function(){alert("There was error uploading files!")}})});$("#videoSearch").submit(function(n){n.preventDefault();var t=new FormData;$("input[type=text],select").each(function(){t.append($(this).attr("name"),$(this).val())});$.ajax({type:"POST",url:"/Youtube/YoutubeSearchAjax",contentType:!1,processData:!1,data:t,success:function(n){console.log(n);$("#SearchResults > div").html(n)},error:function(n){alert("Search Didn't work<br />"+n)}})})});